import {
    GET_DOC_DATA
  } from "../types";

  const initialState = {
    loading: false,
    searchInfo: {},
    doctorInfo: {}
  };

  //depending on the action type we receive, we will do something
  export default function (state = initialState, action) {
    switch (action.type) {
      /*catch action type */
      case GET_DOC_DATA:
        return {
          ...state,
          searchInfo: action.payload,
        };
        case SET_USER:
        return {
          authenticated: true,
          loading: false,
          ...action.payload,
        };
      default:
        return state;
    }
  }
